To decide if S ⇒\* t58 t117 t63 t97, we run the CYK algorithm on the length‑4 input.  Here is the packed computation:

1. Fill in length‑1 cells with any NT → terminal:

   pos 1 (“t58”):  {NT22, NT6, NT14}  
   pos 2 (“t117”): {NT31}  
   pos 3 (“t63”):  {NT17}  
   pos 4 (“t97”):  {NT7, NT28}  

2. Length‑2 spans:

   span (1,2): combine {22,6,14}×{31}.  Only NT25 → NT6 NT31 applies ⇒ {NT25}  
   span (2,3): {31}×{17} gives no match ⇒ ∅  
   span (3,4): {17}×{7,28} gives no match ⇒ ∅  

3. Length‑3 spans:

   span (1,3): split at 1: {22,6,14}×∅ ⇒ ∅; split at 2: {NT25}×{NT17}, and NT1 → NT25 NT17 ⇒ {NT1}  
   span (2,4): both splits involve an empty cell ⇒ ∅  

4. Length‑4 span (1,4):

   splits at 1,2 give ∅;  
   split at 3: {NT1}×{NT7,NT28}.  NT1 NT28 ⇒ S (by S → NT1 NT28).  

Hence S is in the top cell, so the grammar does generate the string.  
Yes

After running a CKY‐style parse, the only nonterminals we ever derive on spans of length ≥2 are  
• P[3..4] = {NT37}  
• P[5..9] = {NT27}  
• P[6..8] = {NT21}, P[6..9] = {NT4}, P[6..10] = {NT28}, P[6..12] = {NT33}, P[7..8] = {NT20}, P[11..12] = {NT15}  

No combination in the full span 1..13 yields the start symbol S. Hence the grammar does *not* generate the given string.  
